        public static unsafe InventoryItem GetEquipped(uint x)
        {
            InventoryItem* equipmentInventoryItem;
            if (x < 0 || x > 13) return new InventoryItem();
            equipmentInventoryItem = InventoryManager.Instance()->GetInventorySlot(InventoryType.EquippedItems, (int)x);
            if (equipmentInventoryItem != null)
            {
                InventoryItem inventoryItem = *equipmentInventoryItem;
                if (inventoryItem.GetItemId() > 0)
                {
                    return inventoryItem;
                }
            }
            InventoryItem item = new InventoryItem();
            item.ItemId = 0;
            return item;
        }

        public static InventoryItem GetEquipped(string slot)
        {
            return GetEquipped(GetEquipSlotCategory(slot));
        }

        public static Item GetGearItem(uint ItemID)
        {
            List<Item> itItem = AllItems.Where(item => item.RowId == ItemID).ToList();
            if (itItem.Count > 0)
                return (Item)itItem[0];
            return new Item();
        }

        public static uint GetEquipSlotCategory(string slot)
        {
            switch (slot)
            {
                case "Weapon":
                    return 0;
                case "Head":
                    return 2;
                case "Body":
                    return 3;
                case "Gloves":
                    return 4;
                case "Legs":
                    return 6;
                case "Boots":
                    return 7;
                case "Earrings":
                    return 8;
                case "Necklace":
                    return 9;
                case "Bracelet":
                    return 10;
                case "RightRing":
                    return 11;
                case "LeftRing":
                    return 12;
                default:
                    return 100;
            }
        }

        public static bool IsCraftable(Item item) { return Craftables.Contains(item.Name.ToString()); }

